import React from 'react';
import Input from '../layout/form/Input';

const SignUp = () => {
  return (
    <div>
        <h1>Sign Up</h1>
        <form>
                <Input content={'Email'} placeholder={'Please Enter An Email'} type={'email'} ></Input>
                <Input content={'First Name'} placeholder={'Please Enter Your First Name'} type={'text'} ></Input>
                <Input content={'Password'} placeholder={'Please Enter Your Last Email'} type={'password'} ></Input>
                <Input content={'Confirm Password'} placeholder={'Please Enter Your Last Email'} type={'password'} ></Input>
                <Input content={'Last Name'} placeholder={'Please Enter Your Last Email'} type={'text'} ></Input>
                <button type="submit"></button>
        </form>
    </div>
  )
}

export default SignUp
